import React from "react";
import { Link, animateScroll as scroll } from "react-scroll";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import Container from "react-bootstrap/Container";
import LinkRoute from "./common/LinkRoute";

import { Logo } from "../assets";

const Header = () => {
  const scrollTo = id => e => {
    e.preventDefault();
    console.log("id", id);
    scroll.scrollTo({
      duration: 1500,
      delay: 100,
      smooth: "easeInOutQuint",
      containerId: id,

    });
  };

  return (
    <header>
      <Navbar bg="none" expand="lg" fixed="top">
        <Container >
          <Navbar.Brand
            href="#home"
            onClick={scrollTo("home")}
            aria-label="Logo"
          >
            <Logo width="90px" height="60px" />
          </Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav">
            <span />
            <span />
            <span />
          </Navbar.Toggle>
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav>
              <Link
                href="#"
                className="nav-link"
                activeClass="active"
                to="/"
                spy={true}
                smooth={true}
                offset={0}
                duration={400}
                style={{color:"#A6D230"}}
              >
                ACCEUIL
              </Link>
               <LinkRoute to="/Professionnel" Text="Professionnel"/>
              <Link
                href="Professionnel"
                className="nav-link"
                activeClass="active"
                to="pacient"
                spy={true}
                smooth={true}
                offset={0}
                duration={400}
                style={{color:"#A6D230"}}
              >
               ESPACES PACIENTS
              </Link>
              <Link
                href="#"
                className="nav-link"
                activeClass="active"
                to="services"
                spy={true}
                smooth={true}
                offset={0}
                duration={400}
                style={{color:"#A6D230"}}
              >
                SERVICES
              </Link>
              <Link
                href="#"
                className="nav-link"
                activeClass="active"
                to="about1"
                spy={true}
                smooth={true}
                offset={0}
                duration={400}
                style={{color:"#A6D230"}}
              >
                A propos
              </Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </header>
  );
};

export default Header;
